  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:16.099315\",\n\t\"name\": \"lake-ilo-national-wildlife-refuge-annual-narrative-report-calendar-year-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Ilo
  National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The planning section discusses the management plan
  and compliance with environmental and cultural resource mandates. Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, other habitats, grazing, haying,
  fire management, and pest control. The wildlife section of the report discusses
  endangered and threatened species, waterfowl, marsh and water birds, shorebirds,
  raptors, other migratory birds, game mammals, other resident wildlife, and animal
  control. The public uses of the Refuge described in this report include interpretive
  exhibits, hunting, fishing, trapping, wildlife observation, picnicking, and law
  enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment utilization
  and replacement, communications systems, and energy conservation. Photographs are
  attached. Brief narratives on White Lake, Stewart Lake, and Pretty Rock National
  Wildlife Refuges are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
